import React from 'react';
import styled from 'styled-components';

function Button(props) {
    console.log(props)
    const arrowIcon = `<svg width="6" height="10" viewBox="0 0 6 10" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M1 1L5 5L1 9" stroke="#000000" stroke-width="1.2" stroke-linecap="round" stroke-linejoin="round"></path></svg>`
    const alarmIcon = `<svg width="14" height="17" viewBox="0 0 22 26" fill="none" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" clip-rule="evenodd" d="M10 23.5C11.1046 23.5 12 22.6046 12 21.5C12 20.3954 11.1046 19.5 10 19.5C8.89543 19.5 8 20.3954 8 21.5C8 22.6046 8.89543 23.5 10 23.5ZM10 26C12.4853 26 14.5 23.9853 14.5 21.5C14.5 19.0147 12.4853 17 10 17C7.51472 17 5.5 19.0147 5.5 21.5C5.5 23.9853 7.51472 26 10 26Z" fill="black"></path><path d="M0 11C0 5.47715 4.47715 1 10 1C15.5228 1 20 5.47715 20 11V19C20 20.1046 19.1046 21 18 21H2C0.895431 21 0 20.1046 0 19V11Z" fill="white"></path><path fill-rule="evenodd" clip-rule="evenodd" d="M17.5 18.5V11C17.5 6.85786 14.1421 3.5 10 3.5C5.85786 3.5 2.5 6.85786 2.5 11V18.5H17.5ZM10 1C4.47715 1 0 5.47715 0 11V19C0 20.1046 0.895431 21 2 21H18C19.1046 21 20 20.1046 20 19V11C20 5.47715 15.5228 1 10 1Z" fill="black"></path><circle cx="17.5" cy="4.5" r="4.5" fill="#EB4C4C"></circle></svg>`
    return (
        <>
           {props.size=='l'?<StBtnL type={props.type}>{props.children}</StBtnL>:(props.size=='m'?<StBtnM>{props.children}</StBtnM>:<StBtnS>{props.children}</StBtnS>)} 
        </>
    );
}

// 스타일
const StBtnL = styled.button`
  height : 50px;
  width : 200px;
  border-radius: 8px;
  border: 3px solid ${(props)=>{
    return props.type == "primary"?'#55EFC4':'#FAB1A0'
  }};
  background-color: rgb(255, 255, 255);
  font-weight: 600;
  cursor: pointer;
`

const StBtnM = styled.button`
  height : 45px;
  width : 130px;
  border-radius: 8px;
  border: 3px solid ${(props)=>{
    return props.type == "primary"?'#55EFC4':'#FAB1A0'
  }};
  background-color: rgb(255, 255, 255);
  cursor: pointer;
`

const StBtnS = styled.button`
  height : 40px;
  width : 100px;
  border-radius: 8px;
  border: 3px solid ${(props)=>{
    return props.type == "primary"?'#55EFC4':'#FAB1A0'
  }};
  background-color: rgb(255, 255, 255);
  cursor: pointer;
`

export default Button;
